import logo from './logo.svg';
import './App.css';
import * as pages from './pages'

function App() {
  let Component
  switch (window.location.pathname) {
    case '/':
      Component = home;
      break
      case "/game":
        Component = game;
        break
        case "/credits":
          Component = credits;
          break
  }
  return 
}

export default App;
